        static public double mod_d(double a, double b)
        {
            long div = (long)(a / b);
            return a - (double)(div * b);
        }

        static public int mod_i(int a, int b)
        {
            int div = (int)((double)a / (double)b);
            return a - (div * b);
        }


        static public double sin(double radian)
        {
            long cycles = 0;
            if (radian > M_PI)
                cycles = (long)(radian * M_1_PI);
            double pi_radian = radian - (double)cycles * M_PI;
            int loc = (int)round((double)pi_radian * 636.3014624813976);
            double val = sin_table[loc];
            if ((cycles & 0x01) == 1)
                val = -(double)val;
            return val;
        }

        static public int my_random()
        {
            return new Random().Next();
        }

        static public int round(double x)
        {
            double temp = x * 10;
            if (mod_d(temp, 10) >= 5)
                return (int)x + 1;
            else
                return (int)x;
        }

        static public double exponential(double x, double y)
        {
            return Math.Pow(x, y);
        }

        public static double max(double a,double b)
        {
            return (a > b) ? a : b;
        }
    }
